import styles from  './Input.module.css'

const Input = () => ({
    label, 
    type = 'text', 
    value, 
    onChange,
    placeHolder,
    required = false
}) => {
    return (
        <div className="{styles.container}">
            {label && <label className='{styles.label}'>{label}</label>}
            <input 
            type={type}
            value = {value}
            onChange={onChange}
            placeholder={placeHolder}
            required={required}
            className='{styles.input}' 
            />
        </div>
    );
};

export default Input;
